import React, {Component} from 'react';

class Nav extends Component {
    render() {
        return (
            <div>
                    <a href="/">Home</a>
                    <a href="/contact">Contact</a>
                    <a href="/about">About</a>
            </div>
        );
    }
}

export default Nav;
